import React from "react";
import alunos from '../../data/alunos'

export default props => {
const li1 = <li>{alunos[0].id} {alunos[0].nome} -> {alunos[0].nota}  </li>
    return(
        <div>
            <ul>
                <li>Ana - 9.7</li>
                <li>Robert - 6.5</li>
                <li>Joao - 8.2</li>
                <li>Pedro - 7.5</li>
            </ul>
        </div>
    );
}
